import Link from "next/link";

const Index = () => (
  <div>
    <h2>Server Side Rendering with Next.js</h2>
    <Link href="/index">
      <a>Home</a>
    </Link>
    <hr />
    <Link href="/about">
      <a>About</a>
    </Link>
  </div>
);

export default Index;
